import math
def GCD(a,b):
    while b!=0:
        t = a%b
        a = b 
        b = t
    return a
def PollardRho(n,c):
    a = 2
    b = 2
    for i in range (n):
        a = (a**2 + c )%n 
        b = (b**2 + c )%n 
        b = (b**2 + c )%n 
        d = GCD(a-b, n)
        if d != 1 and d < n:
            return d
